import React, { useEffect } from "react";
import { Grid } from "@mui/material";
import { BoxPreview } from "./components/Box/BoxPreview";
import ReactFlow from "reactflow";

import "./App.css";

import "reactflow/dist/style.css";
import { BoxComponentPreview } from "./components/Box/BoxComponent";
import { useGetProductDTOQuery } from "./services/api";

function App() {
  const { data, isError, isSuccess, isLoading } = useGetProductDTOQuery();

  if (isError) {
    console.error('Ошибка');
    return null;
  }

  return (
    <div className="App">
      <header className="App-header">
        {/*<div style={{ width: '100vw', height: '100vh' }}>*/}
        {/*    <ReactFlow nodes={initialNodes} edges={initialEdges} />*/}
        {/*</div>*/}
        <Grid container spacing={3} direction="column">
          <Grid item>
            <BoxPreview
              title={data?.team?.name ?? ""}
              type={"team"}
              id={"1"}
              leader={"Чанов Владимир"}
              members={data?.team.users}
              total={3}
            />
          </Grid>
          <Grid item>
            {data?.components && <BoxComponentPreview productComponents={data.components} />}
          </Grid>
        </Grid>
      </header>
      <main></main>
    </div>
  );
}

export default App;
